import React, { useState, useEffect } from 'react'
import SocketIOClient from 'socket.io-client'

export default function Dashboard() {
    const [bids, setBids] = useState([]);

    useEffect(() => {
        const socket = SocketIOClient("http://localhost:3080");
        socket.on("getBids", data => {
            setBids(data);
        });
        return () => socket.disconnect()
    }, []);



    return(
        <div>
            <h2>Dashboard boiii</h2>
            <p>I would very much like to see all the active bids that i am allowed to see</p>
            {bids.map(bid => <button>{bid.object.name}</button>)}
        </div>
    )
}
